b'The new face of pink. @LuciaPicaOfficial draws inspiration from her iconic palette and creates a subversive FALL-WINTER 2020 COLLECTION based on pink. Infused with red, the colour transforms. A lively and sensual carmine pink that becomes radical and transgressive.

